import { Nav, Col, Row, Tab } from 'react-bootstrap';
import Spinner from 'react-bootstrap/Spinner'
const PuppiesPending = () =>{
    const puppies = [
        {_id: 1, name: "Ziggy", gender: "Male", rank: "Pending", icon: "https://github.com/KrotzerSoftwareDevelopment/HomeRaisedCairnsed/blob/main/src/assets/Puppies/Everest%20Litter/BrindleBoy/brindle.jpg?raw=true",dob: "12/16/20" },
        {_id: 2, name: "Remington", gender: "Male", rank: "Pending", dob: "12/16/20", },
]
    // const puppyList = useSelector(state => state.puppyList);
