    //     };
    // }, [])
    // return loading? <div><Spinner animation="border" variant="success" />loading...</div>:
    // error? <div>{error}</div>:
    return (
        <div className="">

            {puppies.filter(puppies => puppies.rank === "Pending").map(puppy =>
         <Link to={'/puppy/' + puppy._id}>
            <div id="PuppyHomeCard">
                {puppy.id}

                {puppy.name}

                </div>
                </Link>
                )}

        </div>

        )
}
export default PuppiesPending;
